from math import gcd


def gen():
    p, q = getPrime(1024), getPrime(1024)
    n, phi = p * q, (p-1) * (q-1)
    while True:
        d = getrandbits(510)
        if gcd(d, phi) == 1:
            e = inverse(d, phi)
            break
    return (n, e)


